import React from "react";
import ReactDOM from "react-dom";
import tours from "../tours.json";
export default class Tourtable extends React.Component {
    constructor(props) {
        super(props);
        this.state = {vttour :  tours.virtual_tour, pttour : tours.physical_tour};
    }



    tourtb(tour)
    {
        console.log(tour);
        var newtour = {"name" : tour.name, "date" : tour.date};
        if(tour.type === "Virtual")
        {
            console.log(this.state.vttour);
            this.state.vttour.push(newtour);
            this.setState({vttour : this.state.vttour});
        }
        else
        {
            console.log(newtour);
            this.state.pttour.push(newtour);
            this.setState({pttour : this.state.pttour});
        }
    }


    virtualdelete(i){
        var newtr = this.state.vttour.filter(function(dt,index) {
                                             if(index!==i.index){return {dt} }});
        this.setState({vttour : newtr});
    }

    physicaldelet(i) {
        var newtr = this.state.pttour.filter(function(dt,index) {
                                             if(index!==i.index){return {dt} }});
        this.setState({pttour : newtr});

    }

    render() {


        var del = <button id = "del" > Delete </button>;
        var vt = this.state.vttour.map((vt, index) =>
                                       (<tr key = {index}><td><button id = "del" onClick = {this.virtualdelete.bind(this, {index})}> Delete </button></td><td>{vt.name}</td><td>{vt.date}</td></tr>));

        var pt = this.state.pttour.map((vt, index) =>
                                       (<tr key = {index}><td><button id = "del" onClick = {this.physicaldelet.bind(this, {index})}> Delete </button></td><td>{vt.name}</td><td>{vt.date}</td></tr>));


        return <div id = "contact">

        <h1>Virtual Tours </h1>
        <table align = "center" ><tbody><tr><th></th><th>Name</th><th>Date</th></tr>{vt}</tbody></table>

        <br/><br/>
        <h1>Physical Tours</h1>
        <table align = "center" ><tbody><tr><th></th><th>Name</th><th>Date</th></tr>{pt}</tbody></table>


        </div>

    }
}
ReactDOM.render(<Tourtable />, document.getElementById("root"));
